import React from 'react';
import { Switch ,Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <Switch>
        <Route path='/login'>登陆界面</Route>
        <Router path='/upload'>上传界面</Router>
      </Switch>
    </div>
  );
}

export default App;
